-- world_db v3.0 (June 2019)


-- drop schema world_db cascade;
create schema world;

set schema 'world';

-- Table Definitions
create table city (
  cityid      integer                not null primary key,
  cityname    varchar(35) default '' not null,
  countrycode char(3) default ''     not null,
  district    varchar(20) default '' not null,
  population  integer default 0      not null
);

create table continent (
  continentid   integer     not null primary key,
  continentname varchar(32) not null
);

create table country (
  countrycode    char(3)        default '' primary key,
  countryname    varchar(52)    default ''    not null,
  continentid    integer                      not null references continent,
  region         varchar(26)    default '',
  surfacearea    numeric(10, 2) default 0.00 not null,
  indepyear      char(4)        default       NULL,
  population     integer default 0            not null,
  lifeexpectancy numeric(3, 1)  default       NULL,
  gnp            numeric(10, 2) default       NULL,
  localname      varchar(45)    default ''    not null,
  governmentform varchar(45)    default ''    not null,
  capitalcityid  integer references city on update cascade on delete cascade,
  code2          char(2) default ''          not null
);

create table language (
  languageid   integer     not null primary key,
  languagename varchar(30) not null
);

create table countrylanguage (
  countrycode char(3)                   not null   references country,
  languageid  integer                   not null   references language,
  percentage  numeric(4, 1) default 0.0 not null,
  isofficial  boolean default false,
  primary key (countrycode, languageid)
);

